window.bookSummaryJSON = "<p>\"Why are you doing this?\"</p> <p>\"Doing what?\"</p> <p>\"Helping these people. Non-citizens. You don't owe them anything. You had a life back in the Dome you could've escaped back to, been protected by your uncle. Why do any of this?\"</p> <p>\"None of this would've happened if it wasn't for my mother, right? I can't just walk away from it, can I?\"</p> <p>Life is a paradise for the privileged on Odin Prime. Dr. Shea Tristan, a loyal Statesman and Chancellor's niece, learns firsthand how broken the state is when she falls into the hands of Shadow - the station's most dangerous criminal organization. A disgraced Valkyrie named Victoria Hammond and an emerging threat among the station's most vulnerable force Shea to confront her mother's shameful past. Shea will question everything she knows about herself, her notorious family, and the state that once protected her.</p>"; 
